const homePage = new _HomePage.default();
const productPage = new _ProductPage.default();
const productListPage = new _ProductListPage.default(); // cy.visit("https://rahulshettyacademy.com/angularpractice/");
cy.visit(Cypress.env("url"));
homePage.getShopTab().click(); // cy.pause();
// cy.debug();
this.data.productName.forEach(element => {
  cy.selectProduct(element);
});
productPage.getCheckOutButton().click();
var sum = 0;
cy.get("tr td:nth-child(4) strong").each(($el, index, $list) => {
  cy.log($el.text());
  const actualAmount = $el.text();
  var res = actualAmount.split(" ");
  res = res[1].trim();
  sum = Number(sum) + Number(res);
}).then(function () {
  cy.log(sum);
});
cy.get("h3 strong").then(function (element) {
  const amount = element.text();
  var res = amount.split(" ");
  var total = res[1].trim();
  expect(Number(total)).to.equal(sum);
});
productListPage.getFinalCheckOutButton().click();
cy.get("#country").type("India");
cy.get(".suggestions > ul > li > a", {
  timeout: 6000
}).click();
cy.get("#checkbox2").click({
  force: true
});
cy.get(".ng-untouched > .btn").click();
cy.get(".alert").then(function (element) {
  const actualText = element.text();
  expect(actualText.includes("Success")).to.be.true;
});
